import Content from "./Content";
import "./Table.css";

const Table = (props) => {
  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>
      {props.data.map((yearData) => (
        <tr>
          <th>{yearData.year}</th>
          <th>{yearData.savingsEndOfYear}</th>
          <th>{yearData.yearlyInterest}</th>
          <th>
            {yearData.savingsEndOfYear -
              intialInvestment -
              yearData.yearlyContribution * yearData.year}
          </th>
          <th>{}</th>
        </tr>
      ))}
      <Content data={props.Data[0]} />
      <Content data={props.Data[1]} />
      <Content data={props.Data[2]} />
      <Content data={props.Data[3]} />
    </table>
  );
};

export default Table;
